import "./rightbar.css";
import MoreVertIcon from '@mui/icons-material/MoreVert';
import AddCircleOutlineIcon from '@mui/icons-material/AddCircleOutline';
import AddCircleOutline from "@mui/icons-material/AddCircleOutline";

function Rightbar() {
  return (
    <div className="rightbar">
      <div className="righrbarWrapper">
      <div className="top"> Stories  <MoreVertIcon /></div>
      <hr className="line"></hr>
      <div className="rightbarLeft">
        <div className="rightbarProfileImg" ><AddCircleOutlineIcon /> </div>
           <span className='rightbarUserName'> Add a new Story</span><br />
           <span className='postTime'>Share an image, a video or some text </span>

           <img className="rightbarProfileImg" src="/assests/dan.jpg" alt="" />
           <span className='rightbarUserName'> Dan Walker</span><br />
           <span className='postTime'> 1 hour ago</span>

           <img className="rightbarProfileImg" src="/assests/dan.jpg" alt="" />
           <span className='rightbarUserName'> Bobby Brown</span><br />
           <span className='postTime'> 3 days ago</span>

           <img className="rightbarProfileImg" src="/assests/dan.jpg" alt="" />
           <span className='rightbarUserName'> Dan Walker</span><br />
           <span className='postTime'> Last week</span>
    </div>
  </div>
   </div>
  );
}

export default Rightbar;
